/** @jsx jsx */
import { jsx, css } from '@emotion/core'
import styled from '@emotion/styled'
import React, { Component } from 'react'
import $ from 'jquery'
import { connect } from 'react-redux'
import { Input, TreeSelect } from 'antd'


import RbMap from '../components/RbMap'
import { Amodule } from '../components/Amodule'
const { Search } = Input
const { SHOW_PARENT, TreeNode } = TreeSelect
class WholeView extends Component{
  constructor(props){
    super(props)
  }
  state = {
    industryValue:[],
    treeData: [
                  {
                    title: 'Node1',
                    value: '0-0',
                    key: '0-0',
                    children: [
                      {
                        title: 'Child Node1',
                        value: '0-0-0',
                        key: '0-0-0',
                        children:[
                          {
                            title: '',
                            value: '0-0-0-0',
                            key: '0-0-0-0',
                          },
                          {
                            title: '222',
                            value: '0-0-0-1',
                            key: '0-0-0-1',
                          }
                        ]
                      },
                    ],
                  },
                  {
                    title: 'Node2',
                    value: '0-1',
                    key: '0-1',
                    children: [
                      {
                        title: 'Child Node3',
                        value: '0-1-0',
                        key: '0-1-0',
                      },
                      {
                        title: 'Child Node4',
                        value: '0-1-1',
                        key: '0-1-1',
                      },
                      {
                        title: 'Child Node5',
                        value: '0-1-2',
                        key: '0-1-2',
                      },
                    ],
                  },
                ],
    cityValue:'',
    cityData: [
                  {
                    title: 'Node1',
                    value: '0-0',
                    key: '0-0',
                    children: [
                      {
                        title: 'Child Node1',
                        value: '0-0-1',
                        key: '0-0-1',
                      },
                      {
                        title: 'Child Node2',
                        value: '0-0-2',
                        key: '0-0-2',
                      },
                    ],
                  },
                  {
                    title: 'Node2',
                    value: '0-1',
                    key: '0-1',
                  },
                ],
    leftW: 300,
  }
  componentDidMount(){
    this._isMounted = true
  }
  industryValueChange = (value)=>{
    if(this._isMounted){
      console.log(value)
      this.setState({ industryValue:value });
    }
  }
  cityValueChange = (value)=>{
    if(this._isMounted){
      console.log(value)
      this.setState({
        cityValue: value
      })
    }
  }
  collapseChange = (value)=>{
    if(this._isMounted){
      this.setState({
        leftW: value
      })
    }
  }
  render(){
    //window
    //
    const tProps = {
      treeData:this.state.treeData,
      value: this.state.industryValue,
      onChange: this.industryValueChange,
      treeCheckable: true,
      showCheckedStrategy: SHOW_PARENT,
      searchPlaceholder: '',
      multiple: true,
      allowClear: true,
      treeNodeFilterProp: 'title',
      maxTagCount: 1,
      maxTagPlaceholder:'...'+this.state.industryValue.length+'',
      style: {
        minWidth: 200,
      },
    }
    const relH = this.props.windowH - 100
    return (
      <div className="formap" css={{position: "relative"}}>
          <div css={{display:"flex"}}>
          {
            this.state.leftW !== 0?
            <div css={{flex:`0 0 ${this.state.leftW}px`}}>
                <div css={{height: `${relH}px`,background:"rgba(0,0,0,0.2)"}}>

                </div>
            </div>
            :
            ''
          }

            <div css={{height: `${relH}px`,flex:"1 1 auto"}}>
              <RbMap />
            </div>
          </div>

        <div css={{width:"100%",height:"50px",lineHeight:"50px",position: "absolute",background:"#ffffff",top:"0px",padding: "0 20px 0 20px",background:"rgba(25,33,57,0.8)"}}>
          <Search
            placeholder=""
            onSearch={value => console.log(value)}
            style={{ width: 200 }}
          />
          <TreeSelect {...tProps} />
          <TreeSelect
            style={{ width: 300 }}
            value={this.state.cityValue}
            dropdownStyle={{ maxHeight: 400, overflow: 'auto' }}
            treeData={this.state.cityData}
            placeholder=""
            treeDefaultExpandAll
            treeNodeFilterProp='title'
            showSearch={true}
            onChange={this.cityValueChange}
            maxTagCount={0}
            maxTagPlaceholder={this.state.cityValue.length}
          />
          <span css={{float: "right"}}><i className="fa fa-chevron-up"></i></span>
        </div>
        {
          this.state.leftW !== 0?
          <span css={{background:"rgba(0,153,51,0.2)",
            position:"absolute", top:"50%",left:"285px",cursor:"pointer",lineHeight:"20px", textAlign:"center",
            "&:hover":{opacity:"0.5"},
            borderRadius:"0 8px 8px 0",
            padding:"10px 3px 10px 3px"
          }}
          onClick={()=>{this.collapseChange(0)}}
          >
            <i className="fa fa-angle-double-left" aria-hidden="true"></i>
          </span>
          :
          <span css={{background:"rgba(0,153,51,0.2)",
            position:"absolute", top:"50%",left:"-20px",cursor:"pointer",lineHeight:"20px", textAlign:"center",
            "&:hover":{opacity:"0.5"},
            borderRadius:"8px 0 0 8px",
            padding:"10px 3px 10px 3px"
          }}
          onClick={()=>{this.collapseChange(300)}}
          >
            <i className="fa fa-angle-double-right" aria-hidden="true"></i>
          </span>
        }
      </div>
    )
  }
}
const mapStateToProps = (state)=>({
  windowH: state.windowH.windowH
})

export default connect(mapStateToProps,null)(WholeView)
